// todo: use .env variables to determine __DEV__ state
export const __DEV__: boolean = Math.random() < 0.5

export const jsonApiContentType = 'application/vnd.api+json'

export const enum JsonApiVersion {
  '1_0' = '1.0',
}

export const enum JsonApiRoot {
  ID = 'id',
  TYPE = 'type',
  ATTRIBUTES = 'attributes',
  RELATIONSHIPS = 'relationships',
  INCLUDED = 'included',
  JSONAPI = 'jsonapi',
  LINKS = 'links',
  DATA = 'data',
  META = 'meta',
  ERRORS = 'errors',
}

export const enum RelationshipMode {
  TO_ONE = 'to-one',
  TO_MANY = 'to-many',
}

export const enum HTTPMethod {
  GET = 'GET',
  POST = 'POST',
}

export enum ApiEventType {
  ERROR = 'error',
  GET = 'get',
  ADD = 'add',
}

export const enum RequestHeader {
  ACCEPT = 'Accept',
  CONTENT_TYPE = 'Content-Type',
  ACCESS_CONTROL_ALLOW_ORIGIN = 'Access-Control-Allow-Origin',
}

export const defaultGetRequestHeaders = {
  [RequestHeader.CONTENT_TYPE]: jsonApiContentType,
}

export const defaultPostRequestHeaders = {
  [RequestHeader.ACCEPT]: jsonApiContentType,
  [RequestHeader.CONTENT_TYPE]: jsonApiContentType,
}

export const enum Typeof {
  BOOLEAN = 'boolean',
  BIGINT = 'bigint',
  FUNCTION = 'function',
  OBJECT = 'object',
  NUMBER = 'number',
  STRING = 'string',
  SYMBOL = 'symbol',
  UNDEFINED = 'undefined',
}
